-- View structure for view_order_full
-- ----------------------------
DROP VIEW IF EXISTS `view_order_full`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_order_full` AS select `order_detail`.`good_id` AS `good_id`,`order_detail`.`good_name` AS `good_name`,`order_detail`.`good_cnt` AS `good_cnt`,`order_detail`.`good_price` AS `good_price`,`order_detail`.`average_cost` AS `average_cost`,`order_detail`.`weight` AS `weight`,`order_detail`.`w_id` AS `w_id`,`order_master`.`order_id` AS `order_id`,`order_master`.`order_sn` AS `order_sn`,`order_master`.`customer_id` AS `customer_id`,`order_master`.`payment_method` AS `payment_method`,`order_master`.`order_money` AS `order_money`,`order_master`.`district_money` AS `district_money`,`order_master`.`shipping_money` AS `shipping_money`,`order_master`.`payment_money` AS `payment_money`,`order_master`.`shipping_comp_name` AS `shipping_comp_name`,`order_master`.`shipping_sn` AS `shipping_sn`,`order_master`.`create_time` AS `create_time`,`order_master`.`shipping_time` AS `shipping_time`,`order_master`.`pay_time` AS `pay_time`,`order_master`.`receive_time` AS `receive_time`,`order_master`.`order_status` AS `order_status`,`order_master`.`order_point` AS `order_point`,`order_master`.`invoice_time` AS `invoice_time`,`order_master`.`modified_time` AS `modified_time`,`order_master`.`order_detail_id` AS `order_detail_id`,`order_detail`.`fee_money` AS `fee_money`,`order_detail`.`memo` AS `memo`,`order_master`.`customer_addr_id` AS `customer_addr_id` from (`order_detail` join `order_master`) where (`order_detail`.`order_detail_id` = `order_master`.`order_detail_id`);

